    [],nt"revision_timestamp": "2015-09-26T23:07:01.354563",nt"name": "gravity-data-for-the-state-of-nevada",nt"isopen":
    false,nt"url": null,nt"notes": "Gravity data for the entire state of Nevada
    and adjacent parts of California, Utah, and Arizona are presented. About 80,000
    gravity stations were compiled primarily by the U.S. Geological Survey. Gravity
    data were reduced to the Geodetic Reference System of 1967 and adjusted to the International
    Gravity Standardization Net 1971 gravity datum. Data were processed to complete
    Bouguer and isostatic gravity anomalies by applying standard gravity corrections
    including terrain corrections and isostatic corrections. This data set was received
    in October, 1997 as a published USGS CD-ROM. For further information, see "Gravity
    Data of Nevada, by David A. Ponce, U.S. Geological Survey Digital Data Series DDS-42,
    1997". A documentation file(readme.txt), describes the contents of this collection
    and includes a description of the data reduction process, selected principal fact
    references, and a list of sources for the data.",nt"license_title": null,nt"extras":
